          <img src={`${process.env.PUBLIC_URL}/assets/logopng.png`} alt="Logo" className="w-[100px] h-[100px] " />
        </div>
        <div className="time" >Horários de Atendimento
          <p>De Segunda à Sábado: 08:OO às 18:00</p>
